import React from 'react';
import styled from 'styled-components';

const Container = styled.div`
  display: flex;
  align-items: center;
  justify-content: center;
`;
const Image = styled.img``;

const Title = () => {
  return (
    <Container>
      <Image src="src/imageimage/logo.png" />
    </Container>
  );
};

export default Title;
